import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { render } from '@testing-library/react';

const App = () => {
	const [superheroes, setSuperHeroes] = useState('');

	console.log('1');

	useEffect(() => {
		(async () => {
			console.log('3');
			const myHeroes = await axios.get('http://localhost:3001');
			console.log('4');

			setSuperHeroes(myHeroes);
		})();
	}, []);

	const renderHeroes = async () => {
		console.log('2');
		superheroes.map((hero) => {
			return (
				<ul>
					<li>{hero.superhero}</li>
					<li>{hero.alter_ego}</li>
				</ul>
			);
		});
	};

	return <div>{renderHeroes()}</div>;
};
export default App;
